const MISAEnum = {

    // Misa thông báo
  MISANotify: {
    Error: { id: 1, title: "Lỗi!" },
    Success: { id: 2, title: "Thành công!" },
    Warning: { id: 3, title: "Cảnh báo!" },
    Info: { id: 4, title: "Thông tin!" },
  },
  MISADialog:{
    Error: { id: 1, title: "Lỗi" },
    Success: { id: 2, title: "Thành công" },
    Warning: { id: 3, title: "Cảnh báo" },
    Info: { id: 4, title: "Thông tin" },
  }
};
export default MISAEnum;
